Sensing Murder (America version 4:3)

Season 1, Episode 5 Hunted in the Forest

Original Air Date 19 October 2006

On July 4th weekend, 2005, Jeannette Bauman and Steven Haugan were viciously murdered in the Oregon wilderness. There were very few leads - and no witnesses. Investigators have hit a brick wall ... and the case remains unsolved. Now - one year later - two of America's top psychics have been called in on the case. Can they help get this investigation back on track ... and bring the killers to justice?

